import React from 'react';
import { View, Text } from 'react-native';

class LoggedOutScanBoard extends React.Component {
    render() {
        return (
            <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}></View>
                <Text>Logged Out Scan Board Screen</Text>
            </View >
        );
    }
}

export default LoggedOutScanBoard;
